import React from "react";
import { mospro } from "./funciones";


export const proy = [
    <ul>
        <li key="1"><a href="#mospro" onClick={mospro}>Mostrar</a></li>
        <li key="2"><a href="#crepro">Crear</a></li>
        <li key="3"><a href="#updpro">Actualizar</a></li>
        <li key="4"><a href="#elimpro">Eliminar</a></li>
    </ul>
];
export const tar = [
    <ul>
        <li key="1"><a href="#mostar">Mostrar</a></li>
        <li key="2"><a href="#cretar">Crear</a></li>
        <li key="3"><a href="#updtar">Actualizar</a></li>
        <li key="4"><a href="#elimtar">Eliminar</a></li>
    </ul>
];
export const usr = [
    <ul>
        <li key="1"><a href="#mosusr">Mostrar</a></li>
        <li key="2"><a href="#creusr">Crear</a></li>
        <li key="3"><a href="#updusr">Actualizar</a></li>
        <li key="4"><a href="#elimusr">Eliminar</a></li>
    </ul>
];
